class Calculadora extends React.Component{
    state = {
        res:"0"
    }

    alert = () => {
        alert('Hola desde un metodo de clase');
    }
    render() {
        return (
            <div>
            <div className="z-depth-2 cyan darken-3 white-text center-align resultados">
                {this.state.res}
            </div>
            <div style={{textAlign: "center"}}>
                <a className="waves-effect waves-light cyan darken-3 btn" onClick={()=>alert('Has dado click en cero')}>0</a>
                <a className="waves-effect waves-light cyan darken-3 btn" onClick={this.alertar}>1</a>
                <a className="waves-effect waves-light cyan darken-3 btn">2</a>
            </div>
            <style jsx>{
                `
                .resultados {
                    width: 300px;
                    margin: 0 auto 10px auto;
                    font-size: 32px;
                }
                `
            }
            </style>
            </div>
        )
    }
}

export default Calculadora
